import React from "react";
import Card from './component/Card/Card'
import Heading from './component/Heading/Heading'
import Data from './data.json';

function App() {
  return (
    <div>
      <Heading/>
      
      <Card name={Data[0].name} age={Data[0].age}/>
      <Card name={Data[1].name} age={Data[1].age}/>
      <Card name={Data[2].name} age={Data[2].age}/>
   

    </div>
  );
}

export default App;
